import clsx from "clsx";
import { Link, Outlet } from "react-router-dom";
const Index = () => {
  return (
    <div>
      <nav className="fixed w-[100%] z-20">
        <ul className={clsx("flex  gap-5 px-6 py-3 text-balck")}>
            <li
              className={clsx(
                "cursor-pointer text-[#055160]",
                "hover:bg-aquamarine px-2 rounded"
              )}
            >
              <Link to="">Home</Link>
            </li>

            <li
              className={clsx(
                "cursor-pointer text-[#055160]",
                "hover:bg-aquamarine px-2 rounded"
              )}
            >
              <Link to="">Dashboard</Link>
            </li>

            <li
              className={clsx(
                "cursor-pointer text-[#055160]",
                "hover:bg-aquamarine px-2 rounded"
              )}
            >
              <Link to="">My Component</Link>
            </li>
        
        </ul>
      </nav>
      <div className="bg-[#f4f4f4] pt-[60px] min-h-[100vh] ">
        <Outlet />
      </div>
    </div>
  );
};

export default Index;
